class TreeNode:
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right

def postorderTraversal(root):
    res = []
    if root:
        res = postorderTraversal(root.left)
        res += postorderTraversal(root.right)
        res.append(root.val)
    return res
